import React from 'react';
import { NavLink } from 'react-router-dom';
import '../App.css';

function Navigation() {
  return (
    <nav className="navigation">
      <ul>
        <li>
          <NavLink exact to='/home' activeClassName='active'>Home</NavLink>
        </li>
        <li>
          <NavLink exact to='/signup' activeClassName='active'>Sign Up</NavLink>
        </li>
        <li>
          <NavLink exact to='/signin' activeClassName='active'>Sign In</NavLink>
        </li>
      </ul>
    </nav>
  );
}

export default Navigation;
